import React, { useState, useEffect } from "react";

const ComplaintDetails = () => {
  const [complaints, setComplaints] = useState([]);
  const [startDate, setStartDate] = useState("2025-02-19");
  const [endDate, setEndDate] = useState("2025-02-26");
  const [selectedType, setSelectedType] = useState("");
  const [selectedStatus, setSelectedStatus] = useState("");

  useEffect(() => {
    // Mock API Data
    const sampleData = [
      {
        id: "1005",
        type: "electricity",
        status: "Open",
        mobile: "1234567888",
        location: "37.421998333333335,-122.084",
      },
      {
        id: "1006",
        type: "water",
        status: "Open",
        mobile: "1234567888",
        location: "37.421998333333335,-122.084",
      },
      {
        id: "1007",
        type: "road",
        status: "Open",
        mobile: "1234567888",
        location: "37.421998333333335,-122.084",
      },
    ];
    setComplaints(sampleData);
  }, []);

  // Filter complaints based on selection
  const filteredComplaints = complaints.filter((complaint) => {
    return (
      (selectedType ? complaint.type === selectedType : true) &&
      (selectedStatus ? complaint.status === selectedStatus : true)
    );
  });

  return (
    <div className="max-w-md mx-auto p-4 bg-white shadow-md rounded-md">
      {/* Header */}
      <h2 className="text-xl font-semibold text-gray-800 text-center mb-4">
        Complaint Details
      </h2>

      {/* Date Filters */}
      <div className="mb-4">
        <h3 className="font-semibold text-gray-600 mb-2">Select Date Range</h3>
        <div className="flex gap-3">
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="w-full p-2 border rounded"
          />
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            className="w-full p-2 border rounded"
          />
        </div>
      </div>

      {/* Type & Status Filters */}
      <div className="mb-4">
        <h3 className="font-semibold text-gray-600 mb-2">Select Type and Status</h3>
        <div className="flex gap-3">
          <select
            value={selectedType}
            onChange={(e) => setSelectedType(e.target.value)}
            className="w-full p-2 border rounded"
          >
            <option value="">Complaint Type</option>
            <option value="electricity">Electricity</option>
            <option value="water">Water</option>
            <option value="road">Road</option>
          </select>

          <select
            value={selectedStatus}
            onChange={(e) => setSelectedStatus(e.target.value)}
            className="w-full p-2 border rounded"
          >
            <option value="">Complaint Status</option>
            <option value="Open">Open</option>
            <option value="Closed">Closed</option>
          </select>
        </div>
      </div>

      {/* Complaints List */}
      <div>
        <h3 className="font-semibold text-gray-600 mb-2">Complaints</h3>
        {filteredComplaints.map((complaint) => (
          <div
            key={complaint.id}
            className="bg-gray-100 p-4 rounded-md shadow-sm mb-3"
          >
            <p className="text-gray-700">
              <strong>Complaint ID:</strong>{" "}
              <a href={`/complaintDetailspage/${complaint.id}`} className="text-blue-500">
                {complaint.id}
              </a>
            </p>
            <p className="text-gray-700">
              <strong>Type:</strong> {complaint.type}
            </p>
            <p className="text-gray-700">
              <strong>Status:</strong> {complaint.status}
            </p>
            <p className="text-gray-700">
              <strong>Mobile No:</strong> {complaint.mobile}
            </p>
            <p className="text-gray-700">
              <strong>Location:</strong> {complaint.location}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ComplaintDetails;
